import React from 'react';

import {Route} from 'react-router-dom';
import CollectionOverview from '../../components/collection-overview/collection-overview.component';
import EachCollectionPage from '../../pages/collection-page/collection-page.component';

import './shopAll-collection.style.css';

const ShopAllPage = ({match}) => (
    <div className='shop-all-page-container'>
        <div className=''>
            <Route exact parh={`${match.path}`} component={CollectionOverview} />
            <Route path={`${match.path}/:collectionId`} component={EachCollectionPage} />
        </div>
    </div>   

);



export default ShopAllPage;
